              name: 'Amilla Fushi',
              description:
                "Located in Baa Atoll, Amilla Fushi is a timeless resort - quintessentially Maldivian - but also an icon in modern luxury. The island’s natural beauty is the perfect setting for the intimate accommodation, with 12-meter high Tree Houses, Beach and Lagoon Houses, and Ocean Reef Houses elevated above the crystal waters comprising our 59 houses. Space and tranquillity are abundant here, and should tempt those looking to rent one of the Private Residences.\n \nAmilla is a lush, verdant retreat - a place to reconnect with yourself through restorative Spa treatments by day and Maldivian bliss by night. Pier-side restaurant par excellence, Lonu, offers a sublime dining experience within Nature's beautiful vistas| Baazaar, encapsulating the 1200sqm pool, is where guests mingle and get delighted by global cuisines and cocktails| the Emperor General Store is the island deli/café, where friends can sample and buy hand-picked imported goods and wines from around the world.",
